import React from 'react'
import { NavLink } from 'react-router-dom';
import './navbar.css';
import Header from '../Header/header';
import AboutMe from '../AboutMe/aboutme';
import PageLink from '../PageLink/PageLink'

const Navbar = () => {
  return (
    <nav className='navbar'>
        <div>
          <PageLink title="Home"/>
          <PageLink title="About Me"/>
            {/* <NavLink to={"/Header"} className='navbarItem'>Home</NavLink>
            <NavLink to="/AboutMe" className='navbarItem'>About Me</NavLink> */}
        </div>
        <div>
          <PageLink title="Experience"/>
          <PageLink title="Contact Me"/>
            {/* <NavLink className='navbarItem'>Experience</NavLink>
            <NavLink className='navbarItem'>Contact Me</NavLink> */}
        </div>
    </nav>
  )
}

export default Navbar
